import React, {Component } from 'react'
import'./Navbar.css'
class Navbar extends Component {
    render (){
        return (
            <div className="navbar">
               <label></label>
                <ul className="nav">
                    <li><a href="#">Portfolio</a></li>
                    <li><a href="#">About</a></li>
                    <li><a href="#" className="active">Home</a></li>
                </ul>
            </div>

        )
    }
}
export default Navbar
